import React, { useState } from "react";
import { useEffect } from "react";
import { Link } from "react-router-dom";
import "./css/Unite.css";

const Unite = ({ openComponent }) => {
    useEffect(() => {
        openComponent();
        // If there is a need to perform any action when the component unmounts, do it in the return function here
        return () => { /* Any cleanup would go here */ };
      }, [openComponent]);
  return (
    <div className="unite-container">
      <div className="unite-header">
      </div>
        <div className="video">
          <iframe
            src="https://player.vimeo.com/video/826604412?h=387a47e31c&badge=0&autopause=0&player_id=0&app_id=58479"
            width="640"
            height="360"
            frameBorder="0"
            allow="autoplay; fullscreen"
            allowFullScreen
          ></iframe>
        </div>

    </div>
  );
};

export default Unite;
